import React from 'react';
import { connect } from 'react-redux'

class Trims extends React.Component {
    render() {
        return (
            <div>
                {this.props.models.years.map(year => year.makes.map(make => make.models.map(model =>  model.trims.map(trim => (
                    <option onClick={this.props.handleTrimChange} value={trim.name} key={trim.id}> {trim.name} </option>
                )))))}
            </div>
        )
    }
}

export default connect(state => state)(Trims);
